import { useMemo, Fragment } from "react";
import {
  Box,
  Title,
  Text,
  Card,
  rem,
  Tooltip,
  Grid,
  Alert,
  Button,
} from "@mantine/core";
import { useBreedImageUrl, useBreed } from "../APIs/cats";
import { BsWikipedia, BsFillHeartFill } from "react-icons/bs";
import { BiHomeSmile } from "react-icons/bi";
import { MdArrowBack, MdChildFriendly, MdEnergySavingsLeaf } from "react-icons/md";
import { FaDog, FaCat, FaSmileBeam } from "react-icons/fa";
import { RiKakaoTalkFill } from "react-icons/ri";
import { IoPeople } from "react-icons/io5";
import { GiHairStrands, GiComb, GiHealthNormal, GiBrain } from "react-icons/gi";
import { useParams, useNavigate } from "react-router-dom";

export function CatBreed() {
  const { breedId } = useParams();
  const { breed, error } = useBreed(breedId);
  const imageUrl = useBreedImageUrl(breedId);
  const navigate = useNavigate();

  const goBack = () => {
    navigate(-1);
  };

  return (
    <>
      <Box
        p={rem(16)}
        sx={{
          width: '100%',
          boxSizing: 'border-box'
        }}
      >
        <Button variant='outline' leftIcon={<MdArrowBack />} onClick={goBack}>Back</Button>
      </Box>
      <Box
        sx={{
          width: "100%",
          display: "flex",
          flexDirection: "column",
          alignItems: "center",
          paddingTop: rem(16),
          paddingBottom: rem(16),
        }}
      >
        {error && <Alert title="Failed to load breed!">{error}</Alert>}
        {breed && (
          <>
            {imageUrl && (
              <img
                src={imageUrl}
                alt={`Image of ${breed.name} cat.`}
                style={{
                  width: "100%",
                  maxWidth: "350px",
                  objectFit: "cover",
                }}
              />
            )}
            <Title py={16}>{breed?.name}</Title>
            <Card>
              <Text>{breed.description}</Text>
            </Card>

            <BreedKnownFors breed={breed} />
            <WikipediaLink breed={breed} />
          </>
        )}
      </Box>
    </>
  );
}

function WikipediaLink({ breed }) {
  return (
    <Box
      component="a"
      href={breed.wikipedia_url}
      sx={{
        display: "flex",
        alignItems: "center",
        gap: rem(8),
        textDecoration: "none",
      }}
    >
      <BsWikipedia />
      <Text>View on Wikipedia</Text>
    </Box>
  );
}

const attributes = {
  adaptability: {
    display: {
      high: "Adapts Well",
      low: "Does not Adapt Well",
    },
    Icon: BiHomeSmile,
  },
  affection_level: {
    display: {
      high: "Very Affectionate",
      low: "Independent",
    },
    Icon: BsFillHeartFill,
    ambiguous: true
  },
  child_friendly: {
    display: {
      high: "Child Friendly",
      low: "Not Child Friendly",
    },
    Icon: MdChildFriendly,
  },
  dog_friendly: {
    display: {
      high: "Dog Friendly",
      low: "Not Dog Friendly",
    },
    Icon: FaDog,
  },
  energy_level: {
    display: {
      high: "High Energy",
      low: "Low Energy",
    },
    Icon: MdEnergySavingsLeaf,
  },
  grooming: {
    display: {
      high: "High Grooming",
      low: "Low Grooming",
    },
    Icon: GiComb,
    inverse: true
  },
  health_issues: {
    display: {
      high: "Prone to health issues",
      low: "",
    },
    Icon: GiHealthNormal,
    inverse: true
  },
  intelligence: {
    display: {
      high: "Intelligent",
      low: undefined,
    },
    Icon: GiBrain,
  },
  shedding_level: {
    display: {
      high: "Sheds a lot",
      low: "Sheds a little",
    },
    Icon: GiHairStrands,
    inverse: true
  },
  social_needs: {
    display: {
      high: "Social",
      low: "Not Social",
    },
    Icon: FaCat,
  },
  stranger_friendly: {
    display: {
      high: "Stranger Friendly",
      low: "Not Stranger Friendly",
    },
    Icon: IoPeople,
  },
  vocalisation: {
    display: {
      high: "Vocal",
      low: "Quiet",
    },
    Icon: RiKakaoTalkFill,
    ambiguous: true
  },
};

function BreedKnownFors({ breed }) {
  const values = useMemo(() => {
    const values = Object.entries(breed).filter(
      ([key, value]) => key in attributes
    );

    const highest = Math.max(
      4,
      values.reduce(
        (acc, [key, value]) => (value > acc ? value : acc), 0
      )
    )

    const findSortKey = (attr, value) => {
      return attr.ambiguous ? 'ambiguous' : !attr.inverse ? (value === 1 ? 'low' : 'high') : (value === 1 ? 'high' : 'low');
    }

    const MapToElement = ([key, value]) => {
      const attr = attributes[key];
      const Icon = attr.Icon;
      const sortKey = findSortKey(attr, value);
      const display = attr.display[sortKey];
      let bg;
      switch (sortKey) {
        case 'high':
          bg = 'green';
          break;
        case 'low':
          bg = 'red';
          break;
        case 'ambiguous':
          bg = 'yellow';
          break;
      }

      const element = display && (
        <Card
          bg={bg}
          sx={{
            display: "flex",
            alignItems: "center",
            gap: rem(8),
          }}
        >
          <Icon />
          <Text>{display}</Text>
          {sortKey}
        </Card>
      );

      return [key, element];
    };

    const allowed = values
      .filter(([_, value]) => value === highest || value === 1);

    const sorted = new Map();
    for (const [key, value] of allowed) {
      // Get the array of values for this key, or create a new one
      const attr = attributes[key];
      const sortKey = findSortKey(attr, value);
      const arr = sorted.get(sortKey);
      if (arr) {
        arr.push([key, value]);
      } else {
        sorted.set(sortKey, [[key, value]]);
      }
    }

    console.log(sorted);

    return [
      ...sorted.get('high') ?? [],
      ...sorted.get('ambiguous') ?? [],
      ...sorted.get('low') ?? []
    ].map(MapToElement);
  }, [breed]);

  return (
    <Box py={rem(32)} sx={{ display: 'flex', flexDirection: 'column', width: "100%", boxSizing: "border-box", justifyContent: 'center', gap: rem(16) }}>
      {values.map(([key, value], index) => (
        <Fragment key={key}>
          {index}
          {value}
        </Fragment>
      ))}
    </Box>
  );
}

const AttributeOrder = {
  Low: -1,
  High: 1,
  Middle: 0
}
